      "value": "URI: http://www.cidoc-crm.org/extensions/crmdig/versions/4.0/D14_Software\r\n\r\nSubClass Of:\r\nD1 Digital Object\r\nSuperClass Of:\r\n-\r\nScope Note:\r\nThis class comprises software codes, computer programs, procedures and functions that are used to operate a system of digital objects.\r\n\r\nExamples:\r\n-",
