   "instances": 0,
   "label": "DensificationAttribute_NearSamplingPointRange",
   "annotations": {
    "http://www.w3.org/2004/02/skos/core#definition": [
     {
      "identifier": "http://www.w3.org/2004/02/skos/core#definition",
      "language": "undefined",
      "value": "Definition of the class F49 Near Sampling Points Range_SFM Point Seeds as a subclass of E13 Attribute Assignment",
      "type": "label"
     }
    ],
    "http://www.w3.org/2004/02/skos/core#example": [
     {
      "identifier": "http://www.w3.org/2004/02/skos/core#example",
      "language": "undefined",
      "value": "\"Specifying the attribute in software that defines the maximum distance within which new points are generated around existing SfM point seeds for terrain modeling (Zephyr 3D).\"",
      "type": "label"
     }
    ],
    "http://www.w3.org/2004/02/skos/core#scopeNote": [
     {
      "identifier": "http://www.w3.org/2004/02/skos/core#scopeNote",
      "language": "undefined",
      "value": "The Near Sampling Points Range_SFM Point Seeds class refers to the attribute assignment process that defines the proximity or range of sampling points used during densification, specifically when working with Structure-from-Motion (SfM) point seeds. This class addresses the specification of a radius or tolerance around each seed point in the initial sparse point cloud, controlling where additional points are generated or matched during densification. It is a critical factor in determining the density and quality of the final point cloud by regulating how closely points are sampled near the seed points.",
      "type": "label"
     }
    ]
   },
