   "annotations": {
    "http://www.w3.org/2004/02/skos/core#definition": [
     {
      "identifier": "http://www.w3.org/2004/02/skos/core#definition",
      "language": "undefined",
      "value": "Definition of the class F55 Depth Noise Filtering as a subclass of E13 Attribute Assignment",
      "type": "label"
     }
    ],
    "http://www.w3.org/2004/02/skos/core#example": [
     {
      "identifier": "http://www.w3.org/2004/02/skos/core#example",
      "language": "undefined",
      "value": "\"In the densified point cloud of AFMNM005, the Depth Noise Filtering includes Adaptive Feature Extraction (AFE), Gradient Field Estimation (GFE), and further Accelerated Gradient Ascent (FAGA) techniques (Lauro 2019).\"",
      "type": "label"
     }
    ],
    "http://www.w3.org/2004/02/skos/core#scopeNote": [
     {
      "identifier": "http://www.w3.org/2004/02/skos/core#scopeNote",
      "language": "undefined",
      "value": "The Depth Noise Filtering class refers to the assignment of depth noise reduction techniques or parameters applied to densified point clouds (F27 Densified Point Cloud). This class captures the process of identifying and filtering out noise, errors, or inaccuracies in the depth values of a point cloud. These filtering operations are particularly necessary in dense datasets where inaccuracies can affect the quality and reliability of subsequent reconstructions.",
      "type": "label"
     }
    ]
   },
