   "label": "SurveyPhase",
   "annotations": {
    "http://www.w3.org/2004/02/skos/core#definition": [
     {
      "identifier": "http://www.w3.org/2004/02/skos/core#definition",
      "language": "undefined",
      "value": "Definition of the class F101 Survey Phase as a subclass of E29 Design and Procedure",
      "type": "label"
     }
    ],
    "http://www.w3.org/2004/02/skos/core#example": [
     {
      "identifier": "http://www.w3.org/2004/02/skos/core#example",
      "language": "undefined",
      "value": "The Survey Phase involved an initial site walk-through and preparation, followed by the actual data acquisition using a terrestrial laser scanner.",
      "type": "label"
     }
    ],
    "http://www.w3.org/2004/02/skos/core#scopeNote": [
     {
      "identifier": "http://www.w3.org/2004/02/skos/core#scopeNote",
      "language": "undefined",
      "value": "The Survey Phase refers to a stage within the acquisition process, which can be divided into various moments such as acquisition, processing, and analysis. Each phase within the survey process addresses a specific task or set of tasks that contribute to the overall objective of collecting spatial, visual, or other relevant data about an object or environment. A Survey Phase may encompass the preparation of equipment, calibration, field operations, and initial data checks, ensuring that the collected data adheres to predefined technical standards. The phases may vary depending on the project\u2019s design and procedural requirements, contributing to the systematic and reproducible execution of the survey.",
      "type": "label"
     }
    ]
   },
