      "value": "Concerning the dense point cloud resulting from the photogrammetric acquisition of the archaeological artifact AFMNM005, workflow chain ALFAfsB001 (which is a boar's jaw subjected to anthropic modifications), the depth noise filtering is based on adaptive feature extraction (AFE), gradient field estimation (GFE), and further accelerated gradient ascent (FAGA).",
